mapper.select:

select 

from SYSCONF
where SYSCONF_SUBSYSNO = #{sysconfSubsysno,jdbcType=DECIMAL}
  and SYSCONF_NAME = #{sysconfName,jdbcType=VARCHAR}

mapper.delete:

delete from SYSCONF
where SYSCONF_SUBSYSNO = #{sysconfSubsysno,jdbcType=DECIMAL}
  and SYSCONF_NAME = #{sysconfName,jdbcType=VARCHAR}
